import React from 'react';
import { Link } from 'react-router-dom';

const personas = [
  { id: 1, nombre: 'Juan', edad: 30 },
  { id: 2, nombre: 'Ana', edad: 40 },
  { id: 3, nombre: 'Luis', edad: 25 }
];

const Home = () => {
  return (
    <div>
      <h1>Listado de Personas</h1>
      <ul>
        {personas.map(persona => (
          <li key={persona.id}>
            <Link to={`/persona/${persona.id}`}>{persona.nombre}</Link>
          </li>
        ))}
      </ul>
      <nav>
        <Link to="/">Home</Link> | <Link to="/estadisticas">Estad√≠sticas</Link> | <Link to="/contacto">Contacto</Link>
      </nav>
    </div>
  );
};

export default Home;
